import { Box, Heading } from "@chakra-ui/react";
import { useRouter } from "next/router";

export default function VideoPage() {
  const router = useRouter();
  const { src } = router.query;

  return (
    <Box>
      <Heading>Video : {src}</Heading>
    </Box>
  );
}
